import React from '/react';
import '../App.css'; 

function BoardFunc() {
  const playerName = "Battleship";
  const playerCash = 1380;
  const totalCash = 1500;
  const propertyColors = ['red', 'red', 'red', 'yellow', 'yellow', 'white', 'white','purple','purple','purple','orange','blue']; // Example
  const historyEvents = [
    "Welcome to Monopoly",
    "Battleship moved to CONNECTICUT AVENUE.",
    "Battleship purchased CONNECTICUT AVENUE, for $120."
  ];

  return (
    <div className="player-info">
      <PlayerHeader playerName={playerName} playerCash={playerCash} totalCash={totalCash}/>
      <PropertyStatus propertyColors={propertyColors} />
      <BankInfo/>
      <History historyEvents={historyEvents} />
    </div>
  );
}

function PlayerHeader({ playerName, playerCash ,totalCash}) {
  return (
    <div className="player-header">
      <div className="player">Player ${totalCash}</div>
      <div className="player-name">{playerName} ${playerCash}</div>
    </div>
  );
}

function PropertyStatus({ propertyColors }) {
  return (
    <div className="property-status">
      {propertyColors.map((color, index) => (
        <div
          key={index}
          className="property-square"
          style={{ backgroundColor: color }}
        ></div>
      ))}
    </div>
  );
}

function BankInfo() {
  return (
    <div className="bank-info">
      <div className="bank">BANK</div>
      <div className="house-hotel">
            <div>0</div>
            <div>0</div>
      </div>
    </div>
  );
}


function History({ historyEvents }) {
  return (
    <div className="history">
        <div>HISTORY</div>
        <div className="time">00:02:20</div>
      {historyEvents.map((event, index) => (
        <div key={index}>
            <div className="time">00:00:{index}9</div>
            {event}
        </div>
      ))}
    </div>
  );
}



export default BoardFunc;
